function yearDifference(e){"use strict";var t=new Date,n={year:t.getUTCFullYear(),month:t.getUTCMonth()+1,day:t.getUTCDate()},r=n.year%e.year;return(n.month<e.month||n.month===e.month&&n.day<e.day)&&(r-=1),r}document.querySelector("#my-age").innerHTML=yearDifference({year:1995,month:3,day:13});